import logo from './logo.svg';
import './App.css';
import Counter from './components/Counter';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';


function App() {
  return (
    <div className="App">
      <header className="App-header">


        <Router>
          <Routes>
            <Route path="/counter" elemennt={<Counter/>}/>
          </Routes>

        </Router>
      </header>
    </div>
  );
}

export default App;
